import React from 'react';

const TeamPage = () => (
  <div className="container">
    <h1>Our Team</h1>
    <p>Meet the amazing team behind this project:</p>
    <ul>
      <li>Member 1 - Frontend</li>
      <li>Member 2 - Backend</li>
      <li>Member 3 - UI/UX Design</li>
    </ul>
  </div>
);

export default TeamPage;
